export class Visitor {
    // Person Data
    fullName = '';
    email = '';
    phone = '';
    personalID = '';
    responsable = '';

    constructor(fullName, email, phone, personalID) {
        this.fullName = fullName;
        this.email = email;
        this.phone = phone;
        this.personalID = personalID;
    }
}
